def trim_df_analyse(address):

    df = pd.read_csv(f'{DIR_DF_ANALYSE}/{address}.csv', header=0)


    if BACKTEST_MODE == 'm':
        if BACKTEST_VALUE <= 3:
            df = df.loc[(df['_actual_minutes_past'] >= BACKTEST_VALUE) & (df['_actual_minutes_past'] <= BACKTEST_VALUE + 10)]

        elif BACKTEST_VALUE <= 30:
            df = df.loc[(df['_actual_minutes_past'] >= BACKTEST_VALUE) & (df['_actual_minutes_past'] <= BACKTEST_VALUE + 15)]

        else:
            df = df.loc[(df['_actual_minutes_past'] >= BACKTEST_VALUE) & (df['_actual_minutes_past'] <= BACKTEST_VALUE + 30)]


    if BACKTEST_MODE == 'mr':

        # 1..{BACKTEST_VALUE}m
        df = df.loc[(df['_actual_minutes_past'] <= BACKTEST_VALUE )]

    elif BACKTEST_MODE == 't':

        df = df.loc[(df['total_trades'] >= BACKTEST_VALUE) & (df['total_trades'] <= BACKTEST_VALUE + 30)]



    if df.empty:
        return None

    if BACKTEST_MODE in ['m', 't']:
        df = df.iloc[0:1]

    df.loc[:, 'token_address'] = address


    # drop_cols = ['block_number','block_timestamp','close','_closest_minute','_closest_trade']
    # for col in df.columns:
    #     if col.startswith('&-'):
    #         drop_cols.append(col)
    # df = df.loc[:, df.columns.isin(drop_cols + ['token_address']) | df.columns.str.startswith('snipers_block1_inf_erc20_to_1|')]

    return df
    

def target_func_max_price_5m(row):
    value = row['&-max_price_5m']
    assert value >= 0, row['token_address']
    if value == 0: return 'max_p_5m|0'
    elif 0 < value < 5: return 'max_p_5m|0_5'
    elif 5 <= value < 15: return 'max_p_5m|5_15'
    elif 15 <= value < 35: return 'max_p_5m|15_35'
    elif value >= 35: return 'max_p_5m|35+'
    assert 1, 'no return'

def target_func_min_price_5m(row):
    value = row['&-min_price_5m']
    assert value <= 0, row['token_address']
    if -5 <= value <= 0: return 'min_p_5m|-5_0'
    if -15 <= value < -5: return 'min_p_5m|-15_-5'
    if -30 <= value < -15: return 'min_p_5m|-30_-15'
    elif value < -30: return 'min_p_5m|-30+'
