def target_func_rows(row):
    value = row['&-rows']
    assert not np.isnan(value) and value != None
    if value < 500:
        return 'rows_0_500'
    elif 500 <= value < 1000:
        return 'rows_500_1k'
    elif 1000 <= value < 2000:
        return 'rows_1k_2k'
    elif 2000 <= value < 5000:
        return 'rows_2k_5k'
    elif value >= 5000:
        return 'rows_5k+'



def pool_catboost(ii, target, df, drop_cols):


    if 0:
        _path = f"{FILES_DIR}/temp/feature_importance"
        _df = pd.read_csv(f'{_path}/{BACKTEST_VALUE}{BACKTEST_MODE}|{target}|all.csv', header=0)
        dfn = _df.to_dict(orient="records")
        all_features = {}
        for i, row in enumerate(dfn):
            all_features[row['feature']] = row['importance']

        all_features = dict(sorted(all_features.items(), key=lambda x: x[1], reverse=True))
        x = f'done {target}; all_features ({len(all_features)}):\n'
        j = 0
        for fe, imp in all_features.items():
            x += f"  {fe} {imp}\n"
            if j == 15:
                break
            j += 1
        most_important_f = ['token_address'] + [v for v in list(all_features.keys())[:350]]
        x += f"most_important_f {target}: {most_important_f}\n"
        print(x)





    X = df.drop(drop_cols, axis=1)
    y = df[target].values
    try:
        X = df[most_important_f]
    except NameError:
        pass

    #X.fillna(X.mean(), inplace=True)


    if ii == 0:
        print(f"df на обучение (BACKTEST_VALUE={BACKTEST_VALUE}{BACKTEST_MODE}):")
        print(X)
        # if len(df) < 4000:
        #     exit('сильно обрезало')


    # scaler = MinMaxScaler(feature_range=(-1, 1))
    # X_scaled_data = scaler.fit_transform(X)


    X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.13, shuffle=True, random_state=42)
    X_val, X_val_addresses, y_val = [], [], []

    X_train_addresses = set(X_train['token_address'].to_list())
    X_test_addresses = set(X_test['token_address'].to_list()) - X_train_addresses
    if X_val:
        X_val_addresses = set(X_val['token_address'].to_list()) - X_test_addresses - X_train_addresses

    X_train = X_train.select_dtypes(exclude=['object'])
    X_test = X_test.select_dtypes(exclude=['object'])
    if X_val:
        X_val = X_val.select_dtypes(exclude=['object'])

    if ii == 0:
        print(f"X_train_addresses={len(X_train_addresses)}, X_test_addresses={len(X_test_addresses)}, X_val_addresses={len(X_val_addresses)}")
        print(f"X_test_addresses:")
        print(list(X_test_addresses))
        if X_val:
            print(f"X_val_addresses:")
            print(list(X_val_addresses))

        print(f"lens: X={len(X)} df={len(df)}")
        print(f"X_train={len(X_train)} ({round(100*len(X_train)/len(X))}%), X_test={len(X_test)} ({round(100*len(X_test)/len(X))}%), X_val={len(X_val)} ({round(100*len(X_val)/len(X))}%)")



    model = CatBoostClassifier(iterations=800, loss_function='MultiClass', verbose=25) # 700
    model.fit(X_train, y_train, early_stopping_rounds=30)

    return {'target': target, 'model': model, 'X_train': X_train, 'X_test': X_test, 'y_train': y_train, 'y_test': y_test}


